  return (a - remainder) / b, remainder
end

local function round(value, digits, mode)
  local mult = 10 ^ (digits or 0)
  local i = value * mult
  if mode == 1 then
    value = trunc(i + (value >= 0 and 0.5 or -0.5))
  elseif mode == 2 then
    value = i >= 0 and floor(i) or ceil(i)
  elseif mode == 3 then
    value = floor(i)
  elseif mode == 4 then
    value = ceil(i)
  else
    value = trunc(i)
    if value ~= i then
      local dif = i - value
      if i >= 0 then
        if dif > 0.5 or (dif == 0.5 and value % 2 ~= 0) then
          value = value + 1  
        end
      else
        if dif < -0.5 or (dif == -0.5 and value % 2 ~= 0) then
          value = value - 1  
        end
      end
    end
  end
  return value / mult
