            { "OnFinishesResearch", 0xC, OnFinishesResearch },
            { "OnReceivesOrder", 0xC, OnReceivesOrder },
            { "OnSellsItem", 0xC, OnSellsItem },
            { "OnSpellEffect", 0xC, OnSpellEffect }
          },
          class = { "Unit", 0x3C }
        }
      end
    }
  end)
end)

