        abilityId = 1093677619 --[[Constants.ABILITY_SPOTT_GUARD_20]]
      elseif level:EndsWith("2") or level:EndsWith("7") then
        abilityId = 1094862401 --[[Constants.ABILITY_BEFEHLSAURA_GUARD_20]]
