      repeat
        local default = GetUnitCurrentOrder(unit)
        if default == 851974 or default == 851976 --[[Constants.ORDER_CANCEL]] or default == 851973 --[[Constants.ORDER_STUNNED]] or default == 851972 --[[Constants.ORDER_STOP]] then
