    -- </summary>
    -- <param name="spawnCommand"></param>
    AddUnitSpawn = function (this, spawnCommand)
      for _, trigger in System.each(this.SpawnTriggers) do
        if trigger.UnitSpawnType == spawnCommand.UnitSpawnType then
          trigger:Add(spawnCommand)
        end
      end
    end
